import React, { useState, useEffect, useRef } from "react";
import axios from "axios";

export default function ChatWindow({ onClose, position = "bottom-right", mode = "production" }) {
  const [messages, setMessages] = useState([
    { from: "bot", text: "Hi — describe your project and I'll help estimate it." }
  ]);
  const [input, setInput] = useState("");
  const [sending, setSending] = useState(false);
  const listRef = useRef(null);

  useEffect(() => {
    if (listRef.current) listRef.current.scrollTop = listRef.current.scrollHeight;
  }, [messages]);

  async function send() {
    const text = input.trim();
    if (!text) return;
    const userMsg = { from: "user", text };
    setMessages(m => [...m, userMsg]);
    setInput("");
    setSending(true);
    try {
      const res = await axios.post("/api/message", { text, client_info: {}, mode });
      const data = res.data;
      if (data.requires_clarification) {
        const q = data.questions || data.questions?.questions || data.intent?.summary || "I need more info.";
        // if questions array present, display them
        if (Array.isArray(data.questions?.questions)) {
          setMessages(m => [...m, { from: "bot", text: "I have some questions to clarify:" }, ...data.questions.questions.map(q => ({ from: "bot", text: q }))]);
        } else if (Array.isArray(data.questions)) {
          setMessages(m => [...m, { from: "bot", text: "I have some questions to clarify:" }, ...data.questions.map(q => ({ from: "bot", text: q }))]);
        } else {
          setMessages(m => [...m, { from: "bot", text: String(q) }]);
        }
      } else if (data.status === "completed") {
        // decode SOW if provided (backend encodes sow in base64)
        const sowText = data.sow ? (atob(data.sow) || "") : "";
        setMessages(m => [...m, { from: "bot", text: "Estimate complete. Summary: " + (data.summary || "") }, { from: "bot", text: `Total cost: ${data.estimate?.totalCost || ""}` }, { from: "bot", text: sowText }]);
      } else if (data.status === "requires_review") {
        setMessages(m => [...m, { from: "bot", text: "Proposal needs human review. Please check the admin panel." }]);
      } else {
        setMessages(m => [...m, { from: "bot", text: JSON.stringify(data) }]);
      }
    } catch (err) {
      setMessages(m => [...m, { from: "bot", text: "Error contacting server." }]);
    } finally {
      setSending(false);
    }
  }

  return (
    <div className={`chat-window ${position === "bottom-left" ? "chat-btn-left" : "chat-btn-right"}`}>
      <div style={{ padding: 8, borderBottom: "1px solid #eee", background: "#fff" }}>
        <strong>Sales chat ({mode})</strong>
        <button style={{ float: "right" }} onClick={onClose}>Close</button>
      </div>

      <div ref={listRef} style={{ padding: 12, height: 260, overflowY: "auto", background: "#f7fbff" }}>
        {messages.map((m, i) => (
          <div key={i} style={{ marginBottom: 8, textAlign: m.from === "user" ? "right" : "left" }}>
            <div style={{ display: "inline-block", padding: "8px 10px", borderRadius: 8, background: m.from === "user" ? "#e2e8f0" : "#fff" }}>
              {m.text}
            </div>
          </div>
        ))}
      </div>

      <div style={{ padding: 8, borderTop: "1px solid #eee", background: "#fff", display: "flex", gap: 8 }}>
        <input value={input} onChange={(e) => setInput(e.target.value)} placeholder="Describe your project..." style={{ flex: 1 }} onKeyDown={(e) => { if (e.key === "Enter") send(); }} />
        <button onClick={send} disabled={sending}>{sending ? "..." : "Send"}</button>
      </div>
    </div>
  );
}
